cars.description:
Säljer vår XC60 som vi ägt i över 9 år. Bilen har fungerat väldigt bra under alla år och med komplett servicebok inkl kamremsbyte enligt intervall. Sommardäck på 20 tum ingår och syns på bilderna. Nya vinterdäck på originalfälgar ingår också. Endast två ägare. Begynnande rost finns vid hjulskärm. 
Skambud undanbedes och besvaras ej. 
 // Armend
